import React, { useState, useEffect, useRef } from "react";
import { motion } from "framer-motion";
import './HomePage.css';

import Banner from './Banner';
import AboutSection from './AboutSection';
import ExclusiveRights from "./ExclusiveRights";
import ContactSection from "./ContactSection";
import OurPartners from "./OurPartners";
import CountdownTimer from "./CountdownTimer";

const sectionVariants = {
  hidden: { opacity: 0, y: 50 },
  visible: { opacity: 1, y: 0, transition: { duration: 0.8, ease: "easeOut" } }
};

const Homepage = () => {
  const [isDragging, setIsDragging] = useState(false);
  const iconRef = useRef(null);

  // Dynamic constraints based on screen size
  const [constraints, setConstraints] = useState({ top: 0, left: 0, right: 0, bottom: 0 });

  useEffect(() => {
    const updateConstraints = () => {
      if (iconRef.current) {
        const iconWidth = iconRef.current.offsetWidth;
        const iconHeight = iconRef.current.offsetHeight;

        setConstraints({
          top: 0,
          left: 0,
          right: window.innerWidth - iconWidth,
          bottom: window.innerHeight - iconHeight,
        });
      }
    };

    updateConstraints();
    window.addEventListener("resize", updateConstraints);
    return () => window.removeEventListener("resize", updateConstraints);
  }, []);

  const handleClick = () => {
    if (!isDragging) {
      window.open("https://franmaxindia.com", "_blank");
    }
  };

  return (
    <div className="homepage">
      <main className="main-content">

        <motion.div initial="hidden" animate="visible" variants={sectionVariants}>
          <Banner />
        </motion.div>

        <motion.div initial="hidden" whileInView="visible" viewport={{ once: true, amount: 0.2 }} variants={sectionVariants}>
          <AboutSection />
        </motion.div>

        <motion.div initial="hidden" whileInView="visible" viewport={{ once: true, amount: 0.2 }} variants={sectionVariants}>
          <ExclusiveRights />
        </motion.div>

        <motion.div initial="hidden" whileInView="visible" viewport={{ once: true, amount: 0.2 }} variants={sectionVariants}>
          <CountdownTimer />
        </motion.div>

        <motion.div initial="hidden" whileInView="visible" viewport={{ once: true, amount: 0.2 }} variants={sectionVariants}>
          <OurPartners />
        </motion.div>

        <motion.div initial="hidden" whileInView="visible" viewport={{ once: true, amount: 0.2 }} variants={sectionVariants}>
          <ContactSection />
        </motion.div>

      </main>

      {/* ================= Draggable Image ================= */}
      <motion.img
        ref={iconRef}
        src={require('../assets/9e5d6c19234ec1aeeba6b782e7c31073.jpg')}
        alt="Draggable Link"
        drag
        dragMomentum={true}
        dragElastic={0.2}
        dragConstraints={constraints} // constrained within screen
        className="floating-icon"
        onDragStart={() => setIsDragging(true)}
        onDragEnd={() => setTimeout(() => setIsDragging(false), 50)}
        onClick={handleClick}
        whileHover={{ scale: 1.05 }}
        whileTap={{ scale: 0.95 }}
        style={{ cursor: 'pointer', width: 60, height: 60, borderRadius: '10%' }}
      />
    </div>
  );
};

export default Homepage;
